import React from 'react'

// export default class UserKeyData {
//     constructor(id, calories, protein, carb, lipid) {
//         this.userId = id
//         this.calorieCount = calories
//         this.proteinCount = protein
//         this.carbohydrateCount = carb
//         this.lipidCount = lipid
//     }
// }

export default class UserKeyData extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            userId: props.id,
            calorieCount: props.calories,
            proteinCount: props.protein,
            carbohydrateCount: props.carb,
            lipidCount: props.lipid,
        }
    }
}
